import CustomModalForm from '../../../../components/custom-modal/CustomModalForm';
import employeeServices from '../../../../services/employeServices/EmployeeServices';
import Table from '../../../../components/custom-table/CustomTable';
import { useState, useEffect } from 'react';
import Toast from '../../../../components/toast-message/ToastMessage';
import CustomPagination from '../../../../components/custom-pagination/CustomPagination';

function EmployeeList() {
	const [employeeList, setEmployeeList] = useState([]);
	const [pageCount, setPageCount] = useState(0);
	const [pagination, setPagination] = useState({
		page: 1,
		size: 10,
	});

	const getEmployeeList = async () => {
		try {
			const response = await employeeServices.getList(pagination);
			if (response.success) {
				setEmployeeList(response.data);
				setPageCount(Math.ceil(response.total / pagination.size));
			} else {
				Toast.error(response.message);
			}
		} catch (error) {
			Toast.error(error.message);
		}
	};

	const addEmployee = async (employeeData) => {
		try {
			const response = await employeeServices.addNew(employeeData);
			if (response.success) {
				Toast.success(response.message);
				getEmployeeList();
			} else {
				Toast.error(response.message);
			}
		} catch (error) {
			Toast.error(error.message || 'An error occurred while adding employee');
		}
	};

	const handlePageClick = (data) => {
		setPagination({
			page: data.selected,
			size: 10,
		});
	};

	useEffect(() => {
		getEmployeeList();
	}, [pagination]);

	const arrayWithTwoObjects = [
		{
			id: 1,
			name: 'John Doe',
			age: 30,
			gender: 'Male',
			occupation: 'Engineer',
			city: 'New York',
			country: 'USA',
			email: 'john.doe@example.com',
			phone: '123-456-7890',
			hello: 'ha',
			god: 'jesus',
			married: false,
		},
		{
			id: 2,
			name: 'Jane Smith',
			age: 28,
			gender: 'Female',
			occupation: 'Designer',
			city: 'Los Angeles',
			country: 'USA',
			email: 'jane.smith@example.com',
			phone: '987-654-3210',
			hello: 'ha',
			god: 'jesus',
			married: true,
		},
		{
			id: 3,
			name: 'Jane Smith',
			age: 28,
			gender: 'Female',
			occupation: 'Designer',
			city: 'Los Angeles',
			country: 'USA',
			email: 'jane.smith@example.com',
			phone: '987-654-3210',
			hello: 'ha',
			god: 'jesus',
			married: true,
		},
		{
			id: 4,
			name: 'Jane Smith',
			age: 28,
			gender: 'Female',
			occupation: 'Designer',
			city: 'Los Angeles',
			country: 'USA',
			email: 'jane.smith@example.com',
			phone: '987-654-3210',
			hello: 'ha',
			god: 'jesus',
			married: true,
		},
		{
			id: 5,
			name: 'Jane Smith',
			age: 28,
			gender: 'Female',
			occupation: 'Designer',
			city: 'Los Angeles',
			country: 'USA',
			email: 'jane.smith@example.com',
			phone: '987-654-3210',
			hello: 'ha',
			god: 'jesus',
			married: true,
		},
	];

	return (
		<>
			<CustomModalForm
				title={'Add new employee'}
				properties={[
					{
						field: 'Name',
						type: 'input',
					},
					{
						field: 'Age',
						type: 'input-number',
					},
					{
						field: 'Email',
						type: 'input',
					},
					{
						field: 'Address',
						type: 'input',
					},
				]}
				formID="addEmployee"
				modalID="employeeModal"
				submitFunction={() => addEmployee('addEmployee')}
			/>
			<div className="card-header d-flex justify-content-between">
				<div>
					<button
						type="button"
						className="btn btn-primary"
						data-bs-toggle="modal"
						data-bs-target="#employeeModal"
					>
						Add employee
					</button>
				</div>
				{pageCount > 0 && (
					<div>
						<CustomPagination pageCount={pageCount} handlePageClick={handlePageClick} />
					</div>
				)}
			</div>
			<div className="card-body">
				<Table data={arrayWithTwoObjects} />
			</div>
		</>
	);
}

export default EmployeeList;
